    var locker = new chms.utils.Locker()

    function setVal(val){
      locker.safeExec(function(){window.val = val});
    }

    function getVal(){return window.val;}

    setVal(0);
    console.log("val is: ", getVal());
    // val is 0

    locker.lock();
    setVal(1);
    console.log("val is: ", getVal());
    // val is 0

